pragma solidity 0.4.21;
pragma experimental ABIEncoderV2;

library BytesTool {
    function memcopy(bytes src, uint srcoffset, bytes dst, uint dstoffset, uint len) pure internal {
        assembly {
            src := add(src, add(32, srcoffset))
            dst := add(dst, add(32, dstoffset))

        // copy 32 bytes at once
            for
            {}
            iszero(lt(len, 32))
            {
                dst := add(dst, 32)
                src := add(src, 32)
                len := sub(len, 32)
            }
            { mstore(dst, mload(src)) }

        // copy the remainder (0 < len < 32)
            let mask := sub(exp(256, sub(32, len)), 1)
            let srcpart := and(mload(src), not(mask))
            let dstpart := and(mload(dst), mask)
            mstore(dst, or(srcpart, dstpart))
        }
    }
}

contract BGRSmall {

    bytes32 x = bytes32(48574670302110873900186887930825348864862875264737285835557344117607811371373);
    bytes32 h = bytes32(32874016276410785723952341262669264316082375692834943036671182319508755362748);

    bool[] b = [false, false, false];
    bytes2[] r = [bytes2(55093), bytes2(64784), bytes2(13966)];

    string[] messages = [
    "MESSAGE 0",
    "MESSAGE 1",
    "MESSAGE 2"
    ];

    //Simulation of PKI
    uint256 e = 65537;
    uint256[] modulus = [
    71592459438769366555287905212920150282388951853471084808236715516732226882039,
    76723212719259523646191797913083315208539844433174054239968451621612127126299,
    92733209039681599712767330020819907773031548378901671974778944208981299740979
    ];


    function test() returns (bytes) {
        bytes memory S = hex"77c6b0c53800d37b6b946df6d343fedededed91a693c25b1ba97cac16879a10b3231a5cea0932a0bc16443b2e82b33ec155a61b29572a5faaf574152bd509a248fdb8ed9d7af";
        uint e = 65537;
        bytes memory N = hex"00890e68c2485f2c725116f259a7ac871e1de3618dfc41e1df8eacc0131b2d433de6ed6d1f36bbf5a401d5afa32eeb2d444cf02a920c81f8088ba0b99d47a0bfdf";

        var (success, ret) = mod3exp(S, e, N);
        return ret;
    }

    function mod3exp(bytes base, uint exponent, bytes modulus) internal returns (bool success, bytes output) {
        uint base_length = base.length;
        uint modulus_length = modulus.length;

        uint size = (32 * 3) + base_length + 32 + modulus_length;
        bytes memory input = new bytes(size);
        output = new bytes(modulus_length);

        assembly {
            mstore(add(input, 32), base_length)
            mstore(add(input, 64), 32)
            mstore(add(input, 96), modulus_length)

            mstore(add(input, add(128, base_length)), exponent)
        }

        BytesTool.memcopy(base, 0, input, 96, base_length);
        BytesTool.memcopy(modulus, 0, input, 96 + base_length + 32, modulus_length);

        assembly {
            success := call(gas(), 5, 0, add(input, 32), size, add(output, 32), modulus_length)
        }
    }

    //function verify(string[] messages, bytes32 x, bytes32 h, bytes2[] r, bool[] b) returns (bool) {
    function verify() returns (bool) {
        bytes32 x_prev = x;
        bytes32 h_prev = h;

        bytes32 g;
        bytes32 eta;
        bytes32 y;
        bytes32 X;

        for (uint i = modulus.length - 1; i > 0; i--) {
            //Line 2
            X = split_inverse(b[i], x_prev);
            y = pi(X, modulus[i]);

            //Line 3 G
            g = GHash(h_prev);

            //Line 4
            x_prev = g ^ y;

            //Line 5 H
            eta = HHash(modulus[i], messages[i], r[i], x_prev);

            //Line 6
            h_prev = h_prev ^ eta;
        }

        //Line 7
        bytes32 h_hash = HHashBase(modulus[0], messages[0], r[0]);
        bytes32 g_hash = GHash(h_prev);

        bytes32 pig = pi(split_inverse(b[0], x_prev), modulus[0]);

        return g_hash == pig && h_hash == h_prev;
    }

    function GHash(bytes32 x) internal pure returns (bytes32) {
        bytes32 hash = keccak256(x);
        return hash & 0x00ffffffffffffffffffffffffffffffffffffffffffffffffffffffffffffff;
    }

    function HHash(uint256 pk, string m, bytes2 r, bytes32 x) internal pure returns (bytes32) {
        return keccak256(pk, m, r, x);
    }

    function HHashBase(uint256 pk, string m, bytes2 r) internal pure returns (bytes32) {
        // this seems to work if Go uses x=nil
        return keccak256(pk, m, r);
    }

    function pi(bytes32 val, uint256 mod) returns (bytes32) {
        return bytes32(modExp(uint256(val), e, mod));
    }

    function modExp(uint256 base, uint256 exp, uint256 mod) internal pure returns (uint256 result)  {
        result = 1;
        for (uint count = 1; count <= exp; count *= 2) {
            if (exp & count != 0)
                result = mulmod(result, base, mod);
            base = mulmod(base, base, mod);
        }
    }

    function split_inverse(bool b, bytes32 x) internal pure returns (bytes32) {
        if (b) {
            return bytes32(uint256(x) + uint256(57896044618658097711785492504343953926634992332820282019728792003956564819968));
            //NOTE: 2 ** 255 = 57896044618658097711785492504343953926634992332820282019728792003956564819968
        }
        else {
            return x;
        }
    }

    function bytesToBytes32(bytes b, uint offset) private pure returns (bytes32) {
        bytes32 out;

        for (uint i = 0; i < 32; i++) {
            out |= bytes32(b[offset + i] & 0xFF) >> (i * 8);
        }
        return out;
    }

}

